import React from "react";
import { Switch, Route } from "react-router-dom";
import Anasayfa from "./components/Anasayfa";
import "./App.css"

const App = () => {
  return (
    <div>
      <div className="header">

      <h1 >Teknolojik Yemekler</h1>

      </div>

      <div className="pages">

      <Switch>
          <Route exact path="/">
            <Anasayfa />
          </Route>
          <Route path="/pizza">
            <SiparişFormu />
          </Route>
          <Route path="/success">
            <SiparişOnay />
          </Route>
        </Switch>

      </div>

    </div>
  );
};

export default App;
